import React from 'react';



function Contato(){
    return(
        <div>   
    
    

        <div class="filme-principal">
            <div class="container">
                    <h3 class="titulo">Quem é ARIELE KETELY? </h3>
                   
                    <p class="descricao">É quem criou este site.Graduada em junho/2021 no curso de Sistemas de Informação na UNIVERSO de Juiz de Fora-MG</p>
                
                <div class="botoes">
                    <a href="https://www.instagram.com/ariele_ketely/">
                        
                        <button role="button" class="botao">
                        <i class="fas fa-play"></i>
                     Instagram
                    </button> </a>

                    <a href="https://www.linkedin.com/in/ariele-ketely-0b1137a1/">
                        
                        <button role="button" class="botao">
                        <i class="fas fa-play"></i>
                      Linkedln
                    </button> </a>

                               </div>
                               
                </div>
            </div>
        </div>
   
    
    
    
    
    
    

  
        

    
    );
};

export default Contato;
